shared_text:
Karen Ford
May 2 at 4:51 PM ·

HHS was well-represented at State Journalism. Very grateful to KSPA for moving a state contest entirely online so all qualifiers could compete. The winners are the following:

The 2018-19 Yearbook All-Kansas Award, Macy Pruitt (graduate) and Megan Lierz (senior), editors;
Sydney Althauser (sophomore) 1st Academics photo;
Ashlynn Herd (junior) 6th Photo Illustration;
Kinsley Watkins (junior) 1st Student Life Photo;
Olivia Yingst (senior) 2nd Headline Writing;
Allison Campbell (junior) 3rd Editing and 3rd Newswriting;
Aaran McAllister (senior) 4th Editorial Writing;
Tymber Klahr (freshman) 6th Feature Writing.

So proud of all! Great way to end a publications year!

